import React, { useState, useEffect } from 'react';
import './Booking.css';
import courseData from './courseSchedule.json';
import { Elements, PaymentElement, useStripe, useElements } from '@stripe/react-stripe-js';
import { loadStripe } from '@stripe/stripe-js';

const stripePromise = loadStripe('pk_live_51Otnc3S6jivUUFNCjV9JH1ZzVB3xtTKoGOviUhuGHoCGrQl3C8EYyctta6OgM1GGIHLBDi5weeKg9KYdbc3TjyQ800ST0dEpOP'); // Replace with your actual public key

function CheckoutForm({ clientSecret }) {
  const stripe = useStripe();
  const elements = useElements();

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!stripe || !elements) return;

    const result = await stripe.confirmPayment({
      elements,
      confirmParams: {
        return_url: window.location.origin + '/success',
      },
    });

    if (result.error) {
      alert(result.error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <PaymentElement />
      <button type="submit" disabled={!stripe}>Pay Now</button>
    </form>
  );
}

export default function BookingPage() {
  const [step, setStep] = useState(1);
  const [selectedLevel, setSelectedLevel] = useState('');
  const [selectedCourse, setSelectedCourse] = useState('');
  const [selectedSession, setSelectedSession] = useState(null);
  const [clientSecret, setClientSecret] = useState('');

  const levels = [...new Set(courseData.map(item => item.year))];
  const allCourses = courseData.filter(course => course.year === selectedLevel);
  const filteredCourses = allCourses.filter(course => course.subject === selectedCourse);

  useEffect(() => {
    if (selectedSession) {
      // On selecting a session, create a payment intent
      const createPaymentIntent = async () => {
        const res = await fetch('http://localhost:5000/api/create-payment-intent', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ amount: parseFloat(selectedSession.fee) * 100 })
        });
        const data = await res.json();
        setClientSecret(data.clientSecret);
      };
      createPaymentIntent();
    }
  }, [selectedSession]);

  return (
    <div className="booking-container">
      {step === 1 && (
        <>
          <h2>Select Course</h2>
          <select value={selectedLevel} onChange={(e) => setSelectedLevel(e.target.value)}>
            <option value="">Select Year</option>
            {levels.map((lvl, idx) => <option key={idx} value={lvl}>{lvl}</option>)}
          </select>
          <select value={selectedCourse} onChange={(e) => setSelectedCourse(e.target.value)}>
            <option value="">Select Subject</option>
            {[...new Set(allCourses.map(c => c.subject))].map((subj, idx) => <option key={idx} value={subj}>{subj}</option>)}
          </select>
          <table>
            <thead>
              <tr><th>Select</th><th>Subject</th><th>From</th><th>To</th><th>Fee</th></tr>
            </thead>
            <tbody>
              {filteredCourses.map((course, idx) => (
                <tr key={idx}>
                  <td><button onClick={() => setSelectedSession(course)}>Choose</button></td>
                  <td>{course.subject}</td>
                  <td>{course.from}</td>
                  <td>{course.to}</td>
                  <td>${course.fee}</td>
                </tr>
              ))}
            </tbody>
          </table>
          <button onClick={() => setStep(2)} disabled={!selectedSession}>Next</button>
        </>
      )}

      {step === 2 && clientSecret && (
        <Elements stripe={stripePromise} options={{ clientSecret }}>
          <CheckoutForm clientSecret={clientSecret} />
        </Elements>
      )}
    </div>
  );
}
